enu','Add to Google Calendar'=>'Přidat do Google Kalendáře','Payment rejected'=>'Platba odvolána','IFSC'=>'IFSC (identifikátor pobočky)','The merchant API Login ID is provided in the Merchant Interface of %s'=>'API Login ID obchodníka je uvedeno v obchodním rozhraní programu% s','End Time - Text field'=>'Koncový čas - textové pole','Start Time - Drop Down list'=>'Počáteční čas - výběrový seznam','Please note, in the %sOptions list%s you can  use times in military time format %s(24 Hour Time)%s only.'=>'Vezměte prosím na vědomí, že v tomto %s seznamu voleb %s můžete použít jen vojenský formát času %s (24 hodinový formát) %s.','End Time - Drop Down list'=>'Konečný čas - výběrový seznam','field'=>'pole','Different time slots, for the different week days'=>'Rozdílný časový výběr pro rozdílné týdny','This feature provides the possibility to use the different time slot selections in the booking form for the different week days or different days - which are assigned to the specific season filters. So each week day (day of specific season filter) can have a different time slots list.'=>'Tato funkce poskytuje možnost používat v různém časovém úseku různé časové výběry v rezervačním formuláři pro jednotlivé dny v týdnu, nebo v různých dnech - které jsou přiřazeny ke konkrétním filtru sezóny. Takže každý den v týdnu (den specifického období filtru), může mít jiný seznam časových úseků.','Configuration'=>'Konfigurace','The general structure of the configuration %scondition rule%s is as follows'=>'Obecná struktura konfigurace %s podmíněná pravidla %s jako následující','Parameters'=>'Parametry','%sname%s – the unique name of the condition group, containing several conditions with different values. For example, if you want to have specific HTML content for the different week days, you can have several conditions, with the same name but with different value parameters in conditions. Please check more about it, in the examples.'=>'%s jméno %s - jedinečný název stavu skupiny, která obsahuje několik podmínek s různými hodnotami. Například, pokud chcete mít konkrétní obsah HTML pro jednotlivé dny v týdnu, můžete mít několik podmínek, se stejným názvem, ale s různými parametry hodnoty v podmínkách. Zkontrolujte si více, v příkladech.','%stype%s – type of the condition. There are 2 types of condition: "weekday" and "season". "weekday" – is the condition rule based on the selected day of week value, like Monday, Tuesday, etc… . "season" – is the condition rule based on the "season filter" name of selected date. In other words the condition is TRUE if the selected day belongs to a season filter in the Season Filters page.'=>'%s vložte %s - typ podmínky. K dispozici jsou 2 typy podmínek: "všední den " a "období ".  "všední den" je pravidlo v závislosti na zvoleném dni v týdnu - hodnoty jako je Pondělí, Úterý, atd ....  "období " - je pravidlo založené na "období filtr " jméno vybraného termínu. Jinými slovy, podmínka je splněna, pokud vybraný den patří do sezóny filtr ve stránce sezóny filtrů.','%svalue%s – value of the specific conditions. If the value is true, the content of the conditions will show in the booking form. You can have the default value (empty – "", or like this – "*") for showing the content of this condition, if all other conditions are FALSE, or at initial stage, when the date in calendar is not yet selected.'=>'%s hodnota %s - hodnota specifických podmínek. Pokud je hodnota pravdivá, bude obsah podmínek v rezervačním formuláři. Můžete mít výchozí hodnotu (prázdný - "", nebo takhle -  "* ") pro zobrazení obsahu této podmínky, jsou-li FALSE, nebo v počáteční fázi, všechny ostatní podmínky, kdy je datum v kalendáři, je dosud vybrána.','Examples'=>'Příklady','Week days conditions.'=>'Podmínky dnů v týdnu.','Duration Time - Drop Down list'=>'Doba trvání - výběrový seznam','default value, if no dates are selected, or none exist conditions are true.'=>'výchozí hodnota, když není vybrán datum nebo žádná podmínka není pravdivá','You can use the several values, separated by comma.'=>'Můžete použít několik hodnot, oddělené čárkou.','Season filters conditions.'=>'Podmínky filtru sezóna.','Season filter on the Season Filters page,'=>'Filtr sezóna na stránce sezóny filtrů,','Season filter on the Season Filters page'=>'Filtr sezóna na stránce sezóny filtrů','Additional info'=>'Další informace','Please use  %sSingle day%s selection mode in the General Booking Settings page at calendar section.'=>'Využijte výběru %s jeden den%s generálním nastavení Rezervační stránky v sekci kalendář.','Please check more about this feature at  %sthis page%s'=>'Prosím zjistěte více o této funkci na %s této straně %s','Time Field'=>'Časové pole','Enter the %sTime%s using the text field.'=>'Vložte %s čas %s užitím textového pole.','This field does not impact to availability (booking for the specific time) .'=>'Toto pole nemá vliv na dostupnost (rezervace na určitý čas).','The value of this field is just saved into DB.'=>'Hodnota tohoto pole je jen uložena do DB.','Country List'=>'Země','Select the country from the predefined country list.'=>'Vyber vlastní zemi z předdefinovaného seznamu zemí.','You can customize the country list at this file: %s'=>'Můžete upravit seznam zemí v tomto souboru: %s','You can insert this field with default selected value.'=>'Můžete vložit toto pole s výchozí vybranou hodnotou.','Example: %s - %s"United States"%s is selected by default.'=>'Příklad: %s -%s  "Spojené státy " %s je ve výchozím nastavení.','Language Sections'=>'Výběr jazyka','Plugin support configurations of the booking form are available in different languages.'=>'Konfigurace Pluginu  podporuje rezervační formuláře v různých jazycích.','The active language of the booking form depends on the active locale of the site.'=>'Aktivní jazyk formuláře závisí na aktivním národní prostředí webu.','Booking Calendar supports WPML and qTranslate plugins for dynamic changing of website locale.'=>'Rezervační kalendář podporuje WPML a qTranslate pluginy